const CarsList = (props) => {
  const listCars = props.userCars.map((cars) => {
    return cars.map((car, pos) => {
      return cars = {
        brand: car.brand,
        series: car.series
      }
    });
  });

  return (
    <div className="cars-list">
      <ul>{listCars}</ul>
    </div>
  );
};

export default CarsList;
